import { container } from "assets/jss/material-kit-react.js";

const componentsStyle = {

  '@font-face': [{
    fontFamily: 'army',
    src: 'url(../fonts/Army_Buster.otf) format(opentype)'
  }],

  container,
  brand: {
    position: 'absolute',
    color: "#ffffff",
    zIndex: "1000",
    marginLeft: "27vw",
    marginTop: "6vh",
  },
  title: {
    fontFamily: "army",
    fontSize: "4.2rem",
    fontWeight: "600",
    display: "inline-block",
    position: "relative"
  },
  subtitle: {
    fontSize: "1.313rem",
    maxWidth: "500px",
    marginLeft: "17vw"
  },
  main: {
    background: "#FFFFFF",
    position: "relative",
    zIndex: "3"
  },
  mainRaised: {
    margin: "-60px 30px 0px",
    borderRadius: "6px",
    boxShadow:
      "0 16px 24px 2px rgba(0, 0, 0, 0.14), 0 6px 30px 5px rgba(0, 0, 0, 0.12), 0 8px 10px -5px rgba(0, 0, 0, 0.2)"
  },
  link: {
    textDecoration: "none"
  },
  textCenter: {
    textAlign: "center"
  }
};

export default componentsStyle;
